import React from 'react';

export default class Privacy extends React.Component{

    render(){

        return(
            <div style={decor.big}>
            <p style={decor.title}>Contact Us</p> 
            <div style={decor.grid}>
            <div>
                <h4>Privacy Policy</h4>
                <p>Adress</p>
            </div>
            <div>
                <h4>Terms of Use</h4>
                <p>Street....</p>

            </div>
        </div>
        <div style={decor.border}></div>
        </div>
        )
    }
}
const decor={
    big:{
        width: '70%',
        margin: 'auto',
        paddingTop: '1em',
        paddingBottom: '2em'
    },
    title: {
        textTransform: 'uppercase',
        textAlign: 'center',
        fontSize: '20px',
        borderBottom: '2px solid rgb(42, 43, 45)',
        padding: '1em',
    },
    grid:{
        width: '40%',
        margin: 'auto',
        display: 'grid',
        gridTemplateColumns: '1fr 1fr',
        gridGap: '3em',
        textAlign: 'center',
        paddingBottom: '3em',
        fontSize: '20px'
    },
    border:{
        borderBottom: '2px solid rgb(42, 43, 45)',
    }
}
